  false,\n\t\"url\": null,\n\t\"notes\": \"Recent developments in digital terrain
  and geospatial database management technology make it possible to protect this investment
  for existing and future projects to a much greater extent than was possible in the
  past. The minimum requirement for hydraulics data includes input and output files
  for all hydraulic models and spatial datasets that are needed to implement the models.
  (Source: FEMA Guidelines and Specs, Appendix M). This Flood Insurance Study was
  produced by RAMPP JV(Dewberry, URS, ESP) for FEMA Region III. Development of a hydraulic
  model to provide water-surface elevations for floodplain mapping requires significant
  investment in time and resources to obtain and process topographic survey data including
  cross-section and bridge surveys. The objective of this Hydraulic data submission
  is to archive the hydrologic data for a study in a database such that it can be
  revised and used with minimum effort in future Flood Insurance Studies or map revisions.\",\n\t\"owner_org\":
